Ext.define('CallCenterApp.view.SqdCallbackPanelViewController', {
    extend: 'Ext.app.ViewController',
    alias: 'controller.sqdcallbackpanel',

    onRefreshBtnClick: function (button, e, eOpts) {
        var sqdCallbackStore = Ext.getStore('SqdCallbackStore');
        var ajaxProxy = sqdCallbackStore.getProxy();
        var url = Ext.getStore('ConfigStore').getAt(0).get('WebServerUrl');
        ajaxProxy.setUrl(url + "/action/sqd/callback/list.do?system=ytadmin@7788");
        sqdCallbackStore.load();
    },

    onSqdCallbackPanelRender: function (component, eOpts) {
        this.onRefreshBtnClick(null, null, null);
    }

});
